  declarations: [
    AppComponent,
    TransactionListComponent,
    TransactionFormComponent 
  ],
  imports: [
    BrowserModule,
    FormsModule, // Add FormsModule to imports
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [TransactionFormComponent]
